import React from "react";
import {
    Col,
    FormGroup,
    Label,
    Button,
    ModalBody,
    ModalFooter,
    Modal,
    ModalHeader, Input
} from "reactstrap";
import Translate from "../../../Translate";
import {Plus, Trash2} from "react-feather";

const SuplliersAddModal = props => {

    return (
        <Modal isOpen={true} size='lg'>
            <ModalHeader>
                <Translate name={'addSupplier'}/>
            </ModalHeader>
            <ModalBody>
                <form>
                    <FormGroup row>
                        <Label for={'firstName'} sm={3}>
                            <Translate name={'name'} />
                        </Label>
                        <Col sm={7} className={'pr-0'}>
                            <input
                                id={'firstName'}
                                type={'text'}
                                value={''}
                                className={`form-control square is-invalid`}
                            />
                        </Col>
                    </FormGroup>
                </form>
            </ModalBody>
            <ModalFooter>
                <Button color="primary" className="btn-square" outline type="submit">
                    <Translate name={'confirm'} />
                </Button>
            </ModalFooter>
        </Modal>
    )
}

export default SuplliersAddModal;
